            { "id", this.safeString2(account, "id", "uuid") },
            { "type", ((bool) isTrue((!isEqual(active, null)))) ? this.safeStringLower(parts, 1) : typeV2 },
            { "code", this.safeCurrencyCode(currencyId) },
            { "info", account },
        };
    }

