        return new Dictionary<string, object>() {
            { "info", conversion },
            { "timestamp", null },
            { "datetime", null },
            { "id", this.safeString(conversion, "id") },
            { "fromCurrency", fromCode },
            { "fromAmount", this.safeNumber(fromAmountStructure, "value") },
            { "toCurrency", toCode },
            { "toAmount", null },
            { "price", null },
            { "fee", this.safeNumber(feeAmountStructure, "value") },
        };
    }

