        if (isTrue(!isEqual(symbols, null)))
        {
            market = this.market(getValue(symbols, 0));
        }
        object type = null;
        var typeparametersVariable = this.handleMarketTypeAndParams("fetchPositions", market, parameters);
        type = ((IList<object>)typeparametersVariable)[0];
