                object seconds = this.seconds();
                object payload = "";
                if (isTrue(!isEqual(method, "GET")))
                {
                    if (isTrue(getArrayLength(new List<object>(((IDictionary<string,object>)query).Keys))))
                    {
                        body = this.json(query);
                        payload = body;
                    }
                } else
                {
                    if (!isTrue(isV3))
                    {
                        if (isTrue(getArrayLength(new List<object>(((IDictionary<string,object>)query).Keys))))
